import React, { Component } from 'react'
import {i18nContext} from 'contexts/i18n';
import withTemplate from 'templates/'

class Page404 extends Component {
  static contextType = i18nContext;
  render(){
    let i18n = this.context;
    return (
      <div className='p-page404'>
        <div className='text-center'>
          <h5> {i18n.error.title} 404 </h5>
          <h3> {i18n.error.page_not_found} </h3>
          <hr />
          <p> {i18n.error.page_not_found_or_removed} </p>
        </div>
      </div>
    )
  }
}
Page404.contextType = i18nContext
export default withTemplate(Page404)
